import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import './App.css';
import LoginPage from './LoginPage';
import RegisterPage from './RegisterPage';

function App() {
  return (
    <Router>
      <div className="welcome-container">
        <div className="welcome-content">
          <h1 className="main-title">PROPSUITE</h1>
          <hr className="divider" />
          <h2 className="subtitle">¡Gestión de edificios al alcance de tus manos!</h2>

          <div className="button-container">
            <Link to="/login" className="custom-button">Iniciar Sesión</Link>
            <Link to="/register" className="custom-button">Registrarse</Link>
          </div>
        </div>

        <Routes>
          <Route path="/login" element={<LoginPage />} />
          <Route path="/register" element={<RegisterPage />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
